import React, { Component } from 'react';

// Components
import Background from './components/Background';
import Desk from './components/Desk';

// Includes
import './Assets/css/default.min.css'

class App extends Component {
  render() {
    return (
      <div className="App">
        <Background></Background>
        <Desk></Desk>
      </div>
    );
  }
}

export default App;
